@Operation bulkValueInStock[monitor=true,delToClassAllowed=false]():Auxiliary::MonetaryValue
  let sum = Auxiliary::MonetaryValue(0.0,Auxiliary::eur)
  in @For p in Challenge23::NonIdentifiableProduct.allMetaInstances()->select(o |
       o.level = 1) do
       sum := sum.add(p.priceAfterTax().mul(p.getInStock()))
     end;
     sum
  end
end

